description:
Frankrijk
Actie / Thriller
128 minuten

goed

met Jean Reno, Arly Jover en Jocelyn Quivrin

Politie-inspecteur Paul Nerteaux begint een onderzoek naar de mysterieuze moord op drie Turkse vrouwen. Het spoor leidt naar 
een bende van het 10e district van Parijs, maar om in het mileu te kunnen infiltreren heeft Nerteaux de hulp nodig van zijn 
vroegere collega Jean-Louis Schiffer. Zijn hulp komt goed van pas, zeker als Nerteaux kennismaakt met de vreemde Anna Heymes, 
de vrouw van een minister die leidt aan hallucinaties en geheugenverlies
-
